import { environment } from "../config/environment";

export const getFolders = async () =>{
    try {
        const response = await fetch(`http://localhost:8080/folder`, {
            'method': 'GET',
	        'headers': {
                'Content-Type': 'application/json'
        	}
        })
            .then(res => res.json())
            .then(res => {return res})

        return response;

    } catch (error) {
        console.error(error);
    }
}
